query postBySlug(
  $slug: String!
) {
  markdownRemark(fields: {slug: {eq: $slug}}) {
    html
    excerpt
    frontmatter {
      title
      date(formatString: "DD.MM.YYYY")
      category
    }
    timeToRead
  }
}

query CategoryPage(
  $category: String!
) {
  allMarkdownRemark(sort: {fields: [frontmatter___date], order: DESC}, filter: {frontmatter: {category: {eq: $category}}}) {
    totalCount
    edges {
      node {
        frontmatter {
          title
          date(formatString: "DD.MM.YYYY")
          category
        }
        fields {
          slug
        }
        excerpt(pruneLength: 200)
        timeToRead
      }
    }
  }
}

