query CategoriesPage {
  allMarkdownRemark {
    group(field: frontmatter___category) {
      fieldValue
      totalCount
    }
  }
}

query IndexQuery {
  allMarkdownRemark(sort: {fields: [frontmatter___date], order: DESC}) {
    edges {
      node {
        fields {
          slug
        }
        frontmatter {
          title
          date(formatString: "DD.MM.YYYY")
          category
        }
        excerpt(pruneLength: 200)
        timeToRead
      }
    }
  }
}
